declare
  num   number;
begin
  select count(1) into num from user_tables where table_name = upper('account_common_agreement_type');
  if num > 0 then
    execute immediate 'drop table account_common_agreement_type';
  end if;
end;
/
-- 共同的协议类型表
CREATE TABLE account_common_agreement_type(
  id NUMBER(20) NOT NULL,
  agreement_type VARCHAR2(32) NOT NULL,
  account_type VARCHAR2(32) NOT NULL,
  agreement_number VARCHAR2(32) NOT NULL,
  agreement_location VARCHAR2(32) NOT NULL,
  account_portfolio_type VARCHAR2(32) NOT NULL,
  CONSTRAINT account_common_agreementtypePK PRIMARY KEY (id)
); 
COMMENT ON COLUMN account_common_agreement_type.id IS 'id';
COMMENT ON COLUMN account_common_agreement_type.agreement_type IS '协议类型（字典表交易：股票等）';
COMMENT ON COLUMN account_common_agreement_type.account_type IS '账户类型(字典表账户类型)';
COMMENT ON COLUMN account_common_agreement_type.agreement_number IS '协议编号（ACCOUNT_COMMON_AGREEMENT表编号）';
COMMENT ON COLUMN account_common_agreement_type.agreement_location IS '协议地点（见数据字典表交易地点类型）';
COMMENT ON COLUMN account_common_agreement_type.account_portfolio_type IS '账户投资组合类型（见字典数据账户投资组合类型）';
COMMENT ON TABLE account_common_agreement_type IS '共同的协议类型表';






